    [],nt"revision_timestamp": "2016-02-28T15:04:19.315487",nt"name": "on-the-statistics-and-predictability-of-go-arounds",nt"isopen":
    true,nt"url": null,nt"notes": "This paper takes an empirical approachrnto
    identify operational factors at busy airports thatrnmay predate go-around maneuvers.
    Using four yearsrnof data from San Francisco International Airport, wernbegin our
    investigation with a statistical approachrnto investigate which features of airborne,
    groundrnoperations (e.g., number of inbound aircraft, numberrnof aircraft taxiing
    from gate, etc.) or weather arernmost likely to fluctuate, relative to nominal operations,rnin
    the minutes immediately preceding a missedrnapproach. We analyze these findings
    both in termsrnof their implication on current airport operationsrnand discuss how
    the antecedent factors may affectrnNextGen. Finally, as a means to assist air traffic
    controllers,rnwe draw upon techniques from the machinernlearning community to develop
    a preliminary alertrnsystem for go-around prediction.",nt"license_title": "U.S.
